                        "text": "Introducing Telegram Web A v10.0!\n\nToday marks a special occasion. Telegram is celebrating its 10th anniversary! In honor of this milestone, and to highlight our web version's long-awaited parity with the native apps, we've leaped from version 1.x straight to 10.0. Big day!\n\nüåü Stories on Telegram\nIntroducing Telegram Stories - share moments of your life, beyond just text.\n\nüíª Desktop Version\nAn experimental standalone version is now available for enthusiasts and early adopters on all desktop platforms: web.telegram.org/a/get.\n\nüöÄ Massive Connection Improvements\nWeb A is now more optimized ‚Äì ensuring speedy and seamless conversations. Less loading, more chatting.\n\nüéôÔ∏è Redesigned Group Calls\nGroup calls have been overhauled to bring exceptional clarity, connectivity, and functionality.\n\nüåç Real-Time Translation\nPremium users can tap to translate entire chats, dynamically updating as they scroll.\n\n‚è±Ô∏è Custom Mute Durations\nNotifications from any chat can be temporarily muted for a specific period ‚Äì like hours, days, or weeks.\n\nüîñ Read Time in Groups\nYou can see at what time other members read your message in the 'Seen By' section.\n\nüòÑ Emoji v15 Support\nWeb A now supports the latest from Emoji v15, so you can express yourself fully.\n\nüé® Dynamic Sticker Packs\nDynamic order for your sticker packs can be toggled on or off ‚Äì whichever you prefer.\n\nüöÄ Performance Upgrades\nWe've implemented multiple memory and performance optimizations for a smoother, faster, more efficient Telegram experience.\n\nüîß Fixes & Improvements\nWe've patched several problems, including issues with sending messages while uploading files, freezes while scrolling, and messages incorrectly marking as read with Web A in the background. See if you can spot the host of UI refinements we added as well.üòâ\n\nüì± More for iPad Users\niPad users, we heard you! Web A now has improved iPad support.\n\nThank you for being with us. Here's to the next decade together! üéâü•≥\n\nü¶Ñ We also welcome you to join our official channels in English and Russian ‚Äî where we post app updates and share our experiences building one of the world‚Äôs most feature-rich web applications.",
